import React from 'react';
import styled from 'styled-components';


const NavClient = styled.nav`
    width: 10vw;
    height: 100vh;
    content: '';
    display: flex;
    flex-direction: column;
    background-color: #3BBE38;
`;

export default function NavBar() {
    return (
        <NavClient>
            <div>1</div>
            <div>1</div>
            <div>1</div>
            <div>1</div>

        </NavClient>
    )
}
